import java.util.HashMap;

public class Anagram {
    public static void main(String[] args) {
        System.out.println(isAnagram("", ""));
    }

    public static boolean isAnagram(String s, String t) {
        System.out.println("first len " + s.length());
        System.out.println("first len " + t.length());

        HashMap<Character, Integer> smap = new HashMap<>();
        HashMap<Character, Integer> tmap = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if(smap.get(c) == null){
                smap.put(c,1);
            }else{
                smap.put(c, smap.get(c)+1);
            }
        }

        for (int j = 0; j < t.length(); j++) {
            char c = t.charAt(j);
            if(tmap.get(c) == null){
                tmap.put(c,1);
            }else{
                tmap.put(c, tmap.get(c)+1);
            }
        }

        System.out.println("map1  " + smap.values().size() );
        System.out.println("map2  " + tmap.values().size() );

        if(smap.values().size() != tmap.values().size()) return false;

        int count = 0;
        for (Character c: smap.keySet() ) {
            System.out.println("inside for " + count);
            count++;
            System.out.println(smap.get(c));
            System.out.println(tmap.get(c));
            System.out.println((smap.get(c)).equals((tmap.get(c))));
            if(!(smap.get(c).equals((tmap.get(c))))) return false;
        }
        return true;
    }
}
